import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#673ab7', // Deep Purple
    },
    secondary: {
      main: '#009688', // Teal
    },
    background: {
      default: '#ffff', // A light purple
    }
  },
});

export default theme;
